import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class List extends Component {
    constructor(props, context) {
      super(props, context);
      this.state = { todos: []}
    } 
    render() {
      return (
        <div className="List">
        </div>
      );
    }
  }
